Brun og blid Vipps solpass is a new solution application allowing to pay for sun time using Vipps payment. New and improved age verification with Vipps will allow easier and more efficient work and faster response. You will get 20% more sunbathing time when using this app.

Simple QR code scan and easy navigation in application will allow you to buy sun time with just a few key taps.

Payment and age verification will be performed using Vipps. So therefore you must have Vipps payment application already installed in your phone. No additional ID verification is required. 

Sun app includes features like:

a) Vouchers for extra discounts from support;

b) Detailed history of past sun hours including time and amount;

c) Payment with Vipps;
